
package org.openapitools.client.model


case class CreateEmbeddingResponse (
    /* The list of embeddings generated by the model. */
    _data: List[Embedding],
    /* The name of the model used to generate the embedding. */
    _model: String,
    /* The object type, which is always \"list\". */
    _object: String,
    _usage: CreateEmbeddingResponseUsage
)
object CreateEmbeddingResponse {
    def toStringBody(var_data: Object, var_model: Object, var_object: Object, var_usage: Object) =
        s"""
        | {
        | "data":$var_data,"model":$var_model,"object":$var_object,"usage":$var_usage
        | }
        """.stripMargin
}
